import React, { useState, useEffect } from 'react';
import "./App.css";
import Textbox from './Textbox'; // Assume you have a Textbox component

interface TextboxData {
  id: string;
  x: number;
  y: number;
  h: number;
  w: number;
  content: string;
}

function App() {
  const [textboxes, setTextboxes] = useState<TextboxData[]>([]);

  useEffect(() => {
    // Simulate fetching data
    const fetchData = async () => {
      // Simulated fetch response
      const data: TextboxData[] = [
        { id: "1", x: 10, y: 20, h: 100, w: 200, content: "Hello World" },
        // Add more textbox data as needed
      ];
      setTextboxes(data);
    };

    fetchData();
  }, []);

  return (
    <div className="App">
      <div id="toolbar">
        {/* Toolbar components here */}
      </div>
      <div id="container">
        {textboxes.map(({ id, x, y, h, w, content }) => (
          <Textbox key={id} id={id} x={x} y={y} h={h} w={w} content={content} />
        ))}
      </div>
    </div>
  );
}

export default App;
